  const sidebar = {
    "name": "Fausto Silva",
    "course": "Ciência da Computação",
    "dashboard": "Dashboard",
    "myarea": "Meus cursos",
  };

  const activities = {
    "id": "1",
    "course": "Algoritmos e Programação",
    "tittle": "Enviar arquivo Peter Smokes",
    "deadline": "10/10/20",
  }

  return (
    <div className="App">
      <Sidebar sidebar={sidebar} />
      <Activities activities/>

    </div>


  );
}

export default App;
